import React from "react";
import CardBtn from "../CardBtn";
import "./style.css";

function Card(props) {
  return (
    <div>
      <div class="container" className="AboutCardBody">
        <p>
          <strong>The Best App To Find What Your Medical Needs.</strong>
          <br></br>
          <br></br>That’s our challenge to provide patients who take pride in
          finding the lowest prices, nearest physicians, and most up-to-date
          medical news.
          <br></br>
          <br></br>WELL-MART Health Providers and Pharmacy Solutions connects a
          community of people with their local medical providers and drug
          stores. In addition, WELL-MART provides its users with the most recent
          medical news - offering a variety of topics scrapped from . What makes WELL-MART so distinctive and unique among
          other healthcare organizations? Easy, it’s the ease our users have
          when searching for the nearest medic or the lowest prescription price.
        </p>
      </div>
    </div>
  );
}

export default Card;
